  [],\n\t\"revision_timestamp\": \"2013-03-15T16:31:02.902351\",\n\t\"name\": \"oil-and-gas-exploration-and-production-in-the-state-of-kentucky-shown-as-quarter-mile-cells\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A cells polygon feature class was created
  by the U.S. Geological Survey (USGS) to illustrate the degree of exploration, type
  of production, and distribution of production in the State of Kentucky. Each cell
  represents a quarter-mile square of the land surface, and the cells are coded to
  represent whether the wells included within the cell are predominantly oil-producing,
  gas-producing, both oil and gas-producing, or the type of production of the wells
  located within the cell is unknown or dry. Data were retrieved from the Kentucky
  Oil and Gas Well Records database and saved as a shapefile of oil and gas well locations
  for Kentucky. Cells were developed as a graphic solution to overcome the problem
  of displaying proprietary well data. No proprietary data are displayed or included
  in the cell maps. The data are current as of 2005.\",\n\t\"license_title\": null,\n\t\"extras\":
